import React, { useState } from 'react'

export default function Forgot() {

    const [nama, setNama] = useState('');

    const handleOnChange = (e) => {
        setNama(e.target.value);
    }

    return (
        <div>
            <p>Nama:{nama}</p>
            <input type="text" onChange={handleOnChange} />
        </div>
    )
}
